records.addlTxt:
Defendant Matthew J Stenberg in court with Attorney Kirk Andrew Redetzke.   District Attorney's Office Law Intern appeared for the State of Wisconsin.  Court quashes warrant.   Defendant enters a guilty plea to Count #3.  Court performs plea colloquy and finds Defendant guilty of Count #3.   Count #1 is dismissed by operation of law.  Count #2 is dismissed and read-in.  State gives sentencing recommendations.  Attorney Redetzke makes statements regarding sentencing.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #3:  WITHHELD SENTENCE:   

TERM OF PROBATION:  1 YEAR;

*D/L REVOCATION: 27 months.
*IGNITION INTERLOCK: 27 months.

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol or illegal drugs 
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed/sign releases.
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling 
*DNA sample to be provided if not yet previously done
*Attend Victim Impact Panel (during time of probation).  Defendant to serve 30 days huber, consecutive, as penalty for failure to attend Victim Impact Panel.  

BLOOD DRAW FEE:  $24.00  (to be paid out of cash bail posted - forwarded to City of Brookfield Police Department);

FINE:  $1,544.00 & $200.00 DNA surcharge  (to be paid out of cash bail posted - remainder to be returned to poster);

CONDITION TIME:  150 Days - Non-working hours with standard release conditions-LAST 60 DAYS STAYED (to be used at agent's discretion) to commence forthwith. Defendant taken into custody.  NOTE:  Days credit to be determined and submitted by Attorney Redetzke within 2 weeks.
